import React,{Component} from 'react';
import { Icon } from 'antd-mobile';


class DetailHeader extends Component {
    render() {
        return (
            <div className="detailHeader">
                <div>
                    <div className="iconLeft"> <FontAwesomeIcon icon="bars" /></div>
                    <div className="iconNav"> <FontAwesomeIcon icon="chevron-left" /></div>
                </div>
                <div className="headerTitle"><h3>项目介绍</h3></div>
                <div className="iconSearch"><FontAwesomeIcon icon="search" /></div>
            </div>
        );

    }
  }



export default DetailHeader
